// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;


//插入排序
contract InsertionSort{
    //if-else
    function ifElseTest(uint256 _number) public pure returns(bool){
        if(_number == 0){
            return (true);
        }else {
            return(false);
        }
    }
    //for循环
    function forLoopTest() public pure returns(uint256){
        uint sum = 0;
        for (uint i = 0; i < 10; i++){
            sum += i;
        }
        return(sum);
    }
}

